import React from "react";
import { useState } from "react";
import { createUserWithEmailAndPassword } from "firebase/auth";
import { auth } from "../../utils/config";
import "./login.css";

function Login() {
  const closeLogin = () => {
    document.getElementById("logcontainer").style.top = "100%";
  };

  const login = async () => {};

  return (
    <div className="login-container" id="logcontainer">
      <div className="exit" onClick={closeLogin}>
        <div className="line1"></div>
        <div className="line2"></div>
      </div>
      <div className="log-head">
        <h1>Log In</h1>
        <input type="email" name="email" id="" placeholder="E-Mail ID..." />
        <input
          type="password"
          name="password"
          id=""
          placeholder="Password..."
        />
        <button id="loginBtn" disabled>
          Login
        </button>
      </div>
    </div>
  );
}

export default Login;
